            <p class=""><span><span style="font-family:宋体;">夏商特邀嘉宾黄勐先生为大家带来了《</span>2017<span style="font-family:宋体;">年漳州跨境电商人才漫谈》，黄勐先生现任漳州芒果帮</span><span style="font-family:Calibri;">CEO</span><span style="font-family:宋体;">，漳州芒果帮是由一群专注实业发展，致力于在本行业不断创新的漳州本地外贸企业自发组成的商业协会。黄勐先生一直对接外贸一线，深知外贸企业的用人情况，向各位老师分析了现在企业的人才需求情况，让各位老师明白当前市场的状况，更好地培养市场紧缺的人才。</span></span><span></span></p>
