      cover : '/static/images/news/4d9a90aef96b3ed7b8c3f3a381506284.jpg',
      dec : '新春大年后我们正式告别了2016年，夏商的伙伴们也开始了2017年的新征程。2017年2月5日、6日，夏商网络科技有限公司在Google AdWords体验中心组织厦门销售总部、合肥技术总部、广州销售团队、深圳销售团队进行了历时两天的新年全员动员大会。 整个动员大会围绕着工作总结、经验分享、发展规划、表扬鼓励展开。总经理孙荣耀先生的新年致辞，肯定了大家过去一年的努力，也指明接下来公司的发展方向；这次动员大会是许多同事第一次见面，彼此介绍相互熟悉拉近了我们的距离；2016年成绩突出的销售同事分享心得体会，大家相互学习共同进步；各部门负责人总结2016年工作结果，规划2017年发展方向；给予2016年突出表现得团队和个人以表扬与奖励。 2016年是夏商网络科技有限公司成立11周年，公司特意为每位六年以上的老员工定制了一枚黄金戒指作为同行六年的特别答谢。 新的一年，夏商全体员工必将更加努力，全体上下一心让夏商走得更远，更好地服务每一位客户。',
