      dec : '极客堂外贸营销实战营深圳站打响新年第一枪。这是极客堂第一次到深圳开课，形成闽粤两地相互呼应。 极客堂第三期第一次走出大本营--厦门--来到深圳，带着未知，我们也有顾虑和担忧，对于一个全新的环境我们也担心不能为大家所认可，万幸的是，你们都来了，有许多同学是不辞辛劳从广州过来的，杰木楷电子技术有限公司的马总更是带病前来，这份支持我们铭记于心。为了保证质量，我们将企业数量尽量控制在十家以内。小规模的精品课程也让我们有了新的感受，都说浓缩的才是精华，老师和同学们都可以充分地交流，大概是因为广州深圳都是包容的城市的缘故，学员们开朗活泼，课堂气氛轻松活跃，提问和回答都积极踊跃，加上张岳老师的幽默，整个课堂时不时发出阵阵笑声。 第四期紧随其后，再次回归厦门，临近春节，不少企业已经呈现出坐等放假的姿态，但是仍有老板没有松懈，圣诞节和春节前后是一家企业最好的转型时机，这段时间老板有足够的时间来制定新的计划和目标。而推掉尾牙来上课同学，这一期比比皆是，同学们来自不同行业，服装、金属、机械，甚至还有来自锁具行业的锁易购，这家企业让同学们大开眼界。各行各业的同学们不存在竞争关系，课上课下交流也很融洽，吃饭时间大家也分析自己现在在做的平台的优劣，其实外贸企业现在面临的同一个问题就是被绑定，而逐渐独立逐渐脱离这是企业摆脱绑定命运的做法。 与前两次外贸营销实战营一样，这次极客堂请到的依然是外贸名师张岳老师为学员们带来三天两夜的导师亲授，张老师有着丰富的实战经验和扎实的理论功底，曾任职美国跨国公司营销副总裁十年，深谙欧美市场的游戏规则；回国后孵化了一家家居家居类企业，创造了一个月出口额从0到180条柜的业界传奇；张老师的实力受到认可，成为国家商务部培训中心跨境电商课题组策划人、特邀讲师；中国科技部火炬中心“COSEP工程”欧美市场网络营销专家；创办了南开大学跨境电子商务研究生班，是南开大学的客座教授。 张老师的课程是围绕海外市场营销展开的，市场营销是一个从找到细分市场开始的螺旋式上升的结构，从细分市场开始，找到能响应客户痛痒的关键词，出现在客户响应客户痛痒的第一现场，通过有吸引力的文案来吸引客户点击，最后从五遵守五个因素来建立着陆页，提高转化率，最后进入销售环节，从这一系列流程中不断地强化、更新细分市场，如此循环往复周而复始。 期间具体传授Google工具的使用方法，虽然不少企业在做Google推广，但是对于Google工具的使用却不一定熟练，都说工欲善其事必先利其器，Google工具对于互联网营销来说无异于是企业营销的武器；对于怎么匹配关键词，撰写具有吸引力的广告文案，设计高转化率的详情页等个性化方面，也给出了具体的方法论，对于学员们牛刀小试的练手之做也是逐个评价讨论。 老师课程中提出的很多理论让同学们耳目一新，颠覆了许多外贸人原有的思路，这就是极客堂外贸营销实战营的意义所在，刷新你的三观，传授秘而不宣的营销技巧，在贸易终端化的大浪潮下抢占先机。',
